import React from "react";
import layerOne from "../assets/slider/parallaximg/layerOne.jpeg";

function ProductName(props) {
  return (
    <>
      <div className="text-start text-6xl leading-tight ">
        <h1>{props.title}</h1>
      </div>
      <div className="text-start py-5 ">
        <h3>{props.text}</h3>
      </div>
      <div className="text-start">
        <h3>{props.ConsistOf}</h3>
        <div className="text-center px-14 py-2">
          <p>{props.discription}</p>
        </div>
      </div>

      <div className="text-start">
        <h3>{props.FeatureOf}</h3>
        <div className="text-center px-14 py-2">
          <p>{props.FeaturesDis}</p>
        </div>
      </div>
      <div className=" flex py-4 pr-16 justify-end items-end ">
        <button
          className="bg-white border-1 shadow-xl border-[#000000] hover:bg-[#D9D9D9] hover:text-primaryFour  text-black font-bold py-2 px-10 "
          w-10>
          Buy Now
        </button>
      </div>
    </>
  );
}

function SliderImg(props) {
  return (
<div className={`image-box w-1/2 h-[70vh] bg-${props.image}`}></div>
  );
}


const Slider = () => {
  return (
    <div
      className=" flex flex-row-reverse w-screen h-screen justify-center items-center"
      id="Shop">
      {/* text section */}
      <div className="container w-1/2 h-screen justify-center items-center text-center p-16 bg-primaryTwo font-inder overflow-auto">
        {/* h1- Product Name */} {/* h3- Sub Heading */}
        h1
      </div>
      {/* Img section */}
      <SliderImg image={layerOne} />
    </div>
  );
};

export default Slider;
